css:
.sheet-toolbar {
  border-bottom: 1px solid #2c2c2c;
  box-shadow: none;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  filter: invert(100%);
}
img.content-dark {
  filter: invert(100%);
}
img.content-light {
  filter: invert(100%);
}
.mail-label {
  filter: contrast(110%) brightness(85%);
}
#message-list .message-item-wrap .message-item-white-wrap {
  box-shadow: 0 0 0.5px rgba(255, 255, 255, 0.28), 0 1px 1.5px rgba(255, 255, 255, 0.08);
}
.thread-list .list-item:not(.unread):not(.selected):not(.focused) {
  color: #aaa;
}
.thread-list .list-item.thread-list-reminder-item {
  background-color: #312856;
}
.thread-list .list-item.thread-list-reminder-item.unread {
  background-color: #312856;
}
.thread-list .list-item.thread-list-reminder-item.unread:not(.focused):not(.selected) {
  background-color: #312856;
}
.send-reminders-header {
  color: #7d5bef;
  background: #312856;
  border-bottom: 1px solid #4d3b8a;
}
.item-count-box {
  min-width: 15px;
  height: 15px;
  text-align: center;
  display: inline;
  font-size: 10.5px;
  padding: 0 0.286em 0 0.286em;
  line-height: 15px;
  border-radius: 2px;
  align-self: center;
}
body.platform-win32 .item-count-box {
  border-radius: 0;
}
.windows-btn-bg {
  transition: background 300ms, box-shadow 300ms;
  background: transparent;
  border-radius: 0;
}
.windows-btn-bg:hover {
  background: rgba(44, 44, 44, 0.8);
}
.windows-btn-border {
  border: 0;
  box-shadow: 0 0 0 2px rgba(44, 44, 44, 0.8);
}
.event-wrapper {
  cursor: default;
  position: relative;
  font-size: 13.02px;
  margin-top: 14px;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  width: 100%;
  display: inline-block;
  border-radius: 3px;
  border: 1px solid #2c2c2c;
}
.event-wrapper .event-header {
  border-bottom: 1px solid #2c2c2c;
  padding: 10px;
  overflow: hidden;
  text-overflow: ellipsis;
}
.event-wrapper .event-header img {
  margin-right: 20px;
}
.event-wrapper .event-header .event-title-text {
  color: rgba(238, 238, 238, 0.6);
}
.event-wrapper .event-header .event-title {
  color: #eee;
}
.event-wrapper .event-header .event-download {
  float: right;
  border-radius: 3px;
  border: 1px solid #2c2c2c;
  padding: 0 4px;
}
.event-wrapper .event-header .event-download img {
  background: rgba(238, 238, 238, 0.6);
  margin: 0;
}
.event-wrapper .event-body {
  padding: 10px;
  color: #eee;
}
.event-wrapper .event-body .event-location {
  user-select: text;
}
.event-wrapper .event-body .event-date {
  display: inline-block;
  width: 100%;
}
.event-wrapper .event-body .event-date .event-day {
  display: block;
  font-size: 15.96px;
  color: #e64d65;
}
.event-wrapper .event-body .event-date .event-time {
  display: inline-block;
  font-size: 20.02px;
  font-weight: 300;
}
.event-wrapper .event-body .event-actions {
  display: flex;
}
.event-wrapper .event-body .event-actions .btn-rsvp {
  margin-right: 10.5px;
  margin-top: 5px;
  min-width: 85px;
  text-align: center;
}
.event-wrapper .event-body .event-actions .btn-rsvp:hover {
  background: #2b2b2b;
}
.event-wrapper .event-body .event-actions .btn-rsvp:active {
  background: #313131;
}
.event-wrapper .event-body .event-actions .btn-rsvp.DECLINED {
  background: #d9534f;
  color: #0a0a0a;
}
.event-wrapper .event-body .event-actions .btn-rsvp.ACCEPTED {
  background: #5cb346;
  color: #0a0a0a;
}
.event-wrapper .event-body .event-actions .btn-rsvp.TENTATIVE {
  background: #888888;
  color: #0a0a0a;
}
body.platform-win32 .event-wrapper {
  border-radius: 0;
}
body.platform-win32 .event-wrapper .event-body .event-actions .btn-rsvp {
  border-radius: 0;
}
